#include <iostream>
#include "../../src/e3extensions/secureint.h"

using namespace std;

string libgDir = "./libg.so";
string gFunctionName = "libg";

#define MAX_NUM 10
//#define NUM 7

int main()
{
	Cryptosystem cs("",32,"",{"","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","","",""},"","", libgDir, gFunctionName);

	SecureInt num("",cs);
	SecureInt f1("",cs);
	SecureInt f2("",cs);
	SecureInt fi("",cs);
	SecureInt i("",cs);
	SecureInt result("",cs);

	int counter = 1;
	do {
		result += (i == num) * fi;
		fi = f1 + f2;
		f1 = f2;
		f2 = fi;
		++i;
	} while (++counter != MAX_NUM);	
	cout << "fib( " << num.str() << " ) = " << result.str() << "\n";

	return 0;
}

